  return (
   <>
   <h1>Hi harshit Dixit</h1>

   <Routes >
        <Route exact path="/" element={<Login />} />
        {/* <Route exact path='/' element = { }/> */}
        <Route exact path="/about" element={<Signup />} />

      </Routes>

   </>
  );
}

export default App;
